DROP SCHEMA IF EXISTS `webshop` ;
CREATE SCHEMA IF NOT EXISTS `webshop` DEFAULT CHARACTER SET utf8 ;
USE `webshop` ;

DROP TABLE IF EXISTS `webshop`.`customer` ;
CREATE TABLE IF NOT EXISTS `webshop`.`customer` (
  `customer_id` INT NOT NULL AUTO_INCREMENT,
  `firstname` VARCHAR(45) NULL,
  `lastname` VARCHAR(45) NULL,
  `email` VARCHAR(45) NULL,
  `bdate` DATE NULL,
  PRIMARY KEY (`customer_id`))
ENGINE = InnoDB;

DROP TABLE IF EXISTS `webshop`.`employee` ;
CREATE TABLE IF NOT EXISTS `webshop`.`employee` (
  `employee_id` INT NOT NULL AUTO_INCREMENT,
  `firstname` VARCHAR(45) NULL,
  `lastname` VARCHAR(45) NULL,
  `bonus` INT NULL,
  `boss_id` INT NULL,
  PRIMARY KEY (`employee_id`),
  INDEX `fk_employee_employee1_idx` (`boss_id` ASC) VISIBLE,
  CONSTRAINT `fk_employee_employee1`
    FOREIGN KEY (`boss_id`)
    REFERENCES `webshop`.`employee` (`employee_id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;


DROP TABLE IF EXISTS `webshop`.`sale` ;
CREATE TABLE IF NOT EXISTS `webshop`.`sale` (
  `sale_id` INT NOT NULL AUTO_INCREMENT,
  `date` DATETIME NULL,
  `type` VARCHAR(45) NULL,
  `customer_id` INT NOT NULL,
  `employee_id` INT NOT NULL,
  PRIMARY KEY (`sale_id`),
  INDEX `fk_sale_customer_idx` (`customer_id` ASC) VISIBLE,
  INDEX `fk_sale_employee1_idx` (`employee_id` ASC) VISIBLE,
  CONSTRAINT `fk_sale_customer`
    FOREIGN KEY (`customer_id`)
    REFERENCES `webshop`.`customer` (`customer_id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_sale_employee1`
    FOREIGN KEY (`employee_id`)
    REFERENCES `webshop`.`employee` (`employee_id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

DROP TABLE IF EXISTS `webshop`.`product` ;
CREATE TABLE IF NOT EXISTS `webshop`.`product` (
  `product_id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NULL,
  `price` DECIMAL(8,2) NULL,
  PRIMARY KEY (`product_id`))
ENGINE = InnoDB;

DROP TABLE IF EXISTS `webshop`.`sale_has_product` ;
CREATE TABLE IF NOT EXISTS `webshop`.`sale_has_product` (
  `sale_has_product_id` INT NOT NULL AUTO_INCREMENT,
  `sale_id` INT NOT NULL,
  `product_id` INT NOT NULL,
  `price` DECIMAL(10,2) NULL,
  `qty` INT NULL,
  PRIMARY KEY (`sale_has_product_id`),
  INDEX `fk_sale_has_product_sale1_idx` (`sale_id` ASC) VISIBLE,
  INDEX `fk_sale_has_product_product1_idx` (`product_id` ASC) VISIBLE,
  CONSTRAINT `fk_sale_has_product_sale1`
    FOREIGN KEY (`sale_id`)
    REFERENCES `webshop`.`sale` (`sale_id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `fk_sale_has_product_product1`
    FOREIGN KEY (`product_id`)
    REFERENCES `webshop`.`product` (`product_id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;





